import React from "react";
import "./App.css";

function Profile(props) {
  console.log(props);
  return (
    <div>
      <h2>{props.name}</h2>
      <p class="">{props.info}</p>
    </div>
  );
}

function App() {
  return (
    <div className="App">
      <Profile name="Ludvig" info="people pleaser"/>
      <Profile name="Sigrid" info="manipulator"/>
    </div>
  );
}

export default App;
